package misc;

import java.util.HashSet;
import java.util.Set;

public class DordleDictionary {

  private static final Set<String> allowed = decompress("");
  private static final Set<String> answers = decompress("");

  public static Set<String> getAllowed() {
    return allowed;
  }

  public static Set<String> getAnswers() {
    return answers;
  }

  private static Set<String> decompress(String text) {
    String lastword = "zzzzz";
    Set<String> words = new HashSet<>();
    int i = 0;
    int j = 0;
    while (j < text.length()) {
      if ((text.charAt(j) < 96 || j == text.length() - 1) && i < j) {
        String word = (lastword.substring(0, 5 - (j - i)) + text.substring(i, j)).toUpperCase();
        words.add(word);
        lastword = word;
        i = j;
      }
      j++;
    }
    return words;
  }


}
